problem:
Below is the graph of $y = a \sin (bx + c)$ for some positive constants $a,$ $b,$ and $c.$  Find the smallest possible value of $c.$

[asy]import TrigMacros;

size(300);

real f(real x)
{
	return 2*sin(4*x + pi/2);
}

draw(graph(f,-pi,pi,n=700,join=operator ..),red);
trig_axes(-pi,pi,-3,3,pi/2,1);
layer();
rm_trig_labels(-2,2, 2);

label("$1$", (0,1), E);
label("$2$", (0,2), E);
label("$-1$", (0,-1), E);
label("$-2$", (0,-2), E);
[/asy]

In triangle $ABC,$ $AB = 9,$ $BC = 10,$ and $AC = 11.$  If $D$ and $E$ are chosen on $\overline{AB}$ and $\overline{AC}$ so that $AD = 4$ and $AE = 7,$ then find the area of triangle $ADE.$

[asy]
unitsize (1 cm);

pair A, B, C, D, E;

A = (2,3);
B = (0,0);
C = (6,0);
D = interp(A,B,0.4);
E = interp(A,C,3/5);

draw(A--B--C--cycle);
draw(D--E);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$E$", E, NE);
[/asy]

Let $P$ be the point on line segment $\overline{AB}$ such that $AP:PB = 2:7.$  Then
\[\overrightarrow{P} = t \overrightarrow{A} + u \overrightarrow{B}\]for some constants $t$ and $u.$  Enter the ordered pair $(t,u).$

[asy]
unitsize(1 cm);

pair A, B, P;

A = (0,0);
B = (5,1);
P = interp(A,B,2/9);

draw(A--B);

dot("$A$", A, S);
dot("$B$", B, S);
dot("$P$", P, S);
[/asy]

solution:
Using the extended Sine law, we find the circumradius of $ABC$ to be $R = \frac{BC}{2\sin A} = 4\sqrt 2$.

[asy]
unitsize(0.8 cm);

pair A, B, C, O, P;

A = (0,0);
B = (2,2);
C = (5,0);
P = interp(B,C,3/8);
O = circumcenter(A,B,C);

draw(A--B--C--cycle);
draw(circumcircle(A,B,C));
draw(O--P);

label("$A$", A, W);
label("$B$", B, N);
label("$C$", C, E);
dot("$O$", O, S);
dot("$P$", P, NE);
[/asy]

By considering the power of point $P$, we find that $R^2 - OP^2 = PB \cdot PC = 15$. So $OP = \sqrt{R^2 - 15} = \sqrt{ 16 \cdot 2 - 15} = \boxed{\sqrt{17}}$.

We can expand the determinant as follows:
\begin{align*}
\begin{vmatrix} 1 & x & y \\ 1 & x + y & y \\ 1 & x & x + y \end{vmatrix} &= \begin{vmatrix} x + y & y \\ x & x + y \end{vmatrix} - x \begin{vmatrix} 1 & y \\ 1 & x + y \end{vmatrix} + y \begin{vmatrix} 1 & x + y \\ 1 & x \end{vmatrix} \\
&= ((x +  y)^2 - xy) - x((x + y) - y) + y(x - (x + y)) \\
&= \boxed{xy}.
\end{align*}

By the Law of Cosines,
\[\cos A = \frac{3^2 + 6^2 - 8^2}{2 \cdot 3 \cdot 6} = -\frac{19}{36}.\][asy]
unitsize (1 cm);

pair A, B, C, D;

B = (0,0);
C = (8,0);
A = intersectionpoint(arc(B,3,0,180),arc(C,6,0,180));
D = interp(B,C,3/9);

draw(A--B--C--cycle);
draw(A--D);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
[/asy]

Then
\[\cos \angle BAD = \cos \frac{A}{2} = \sqrt{\frac{1 + \cos A}{2}} = \boxed{\frac{\sqrt{34}}{12}}.\]

By product-to-sum,
\begin{align*}
4 \sin x \sin (60^\circ - x) \sin (60^\circ + x) &= 4 \sin x \cdot \frac{1}{2} (\cos 2x - \cos 120^\circ) \\
&= 2 \sin x \left( \cos 2x + \frac{1}{2} \right) \\
&= 2 \sin x \cos 2x + \sin x.
\end{align*}Again by product-to-sum,
\begin{align*}
2 \sin x \cos 2x + \sin x &= \sin 3x + \sin (-x) + \sin x \\
&= \boxed{\sin 3x}.
\end{align*}

problem:
The parametric curve $(x,y) = (\sin t, \sin 2t)$ is plotted below.

[asy]
unitsize(2 cm);

pair moo (real t) {
  return (sin(t),sin(2*t));
}

real t;
path foo = moo(0);

for (t = 0; t <= 2*pi + 0.1; t = t + 0.1) {
  foo = foo--moo(t);
}

draw((-1.2,0)--(1.2,0));
draw((0,-1.2)--(0,1.2));
draw(foo,red);
[/asy]

This curve can also be expressed in the form
\[ax^4 - bx^2 + cy^2 = 0,\]where $a,$ $b,$ and $c$ are positive integers.  Find the smallest possible value of $a + b + c.$
